import React from 'react';

const Formulario = () => {
    return ( 
        <div className="bg-info">
            <div className="container">
                <div className="row">
                    <from className="col card text-white bg-transparent mb-5 pt-5 pb-2">
                        <fieldset>
                            <legend>Buscador Letras</legend>
                        </fieldset>
                    </from>
                </div>
            </div>
        </div>
     );
}
 
export default Formulario;
